import React, {Fragment} from 'react';
import logo from './logo.svg';
import './App.css';

import InputCampaign from './components/InputCampaign';
import ListCampaign from './components/ListCampaign';

function App() {
  return (
    <Fragment>
      <div className = "container">
        <InputCampaign/>
        <ListCampaign/>
      </div>
    </Fragment>
  );
}

export default App;
